import React from 'react'
import { Button, } from 'antd';

export default class Feedback extends React.Component {

  render() {

    return(
        <div>
          <p>你已经完成 :credit 学分</p>
          <Button htmlType="button">生成报告</Button>
        </div>
    )
  }

}
